import React, { useEffect, useState } from 'react';
import axios from 'axios';

const OutsidersData = () => {
    const [outsiders, setOutsiders] = useState([]);
    const [error, setError] = useState(null); // To handle errors

    useEffect(() => {
        const fetchOutsiders = async () => {
            try {
                const response = await axios.get('http://localhost:8080/api/outsiders'); // Ensure this URL is correct
                setOutsiders(response.data);
            } catch (error) {
                console.error('Error fetching outsiders:', error);
                setError('Failed to fetch data.'); // Handle errors gracefully
            }
        };

        fetchOutsiders();
    }, []);

    return (
        <div>
            <h1>Outsiders Data</h1>
            {error && <p>{error}</p>} {/* Display error message if any */}
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Contact</th>
                        {/* Add more headers as needed */}
                    </tr>
                </thead>
                <tbody>
                    {outsiders.map((outsider) => (
                        <tr key={outsider.id}>
                            <td>{outsider.id}</td>
                            <td>{outsider.name}</td>
                            <td>{outsider.contact}</td>
                            {/* Add more cells as needed */}
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default OutsidersData;
